  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Prime Hook National
  Wildlife Refuge outlines Refuge accomplishments during the 1976 calendar year. The
  report begins with an introduction to the Refuge and information about weather conditions,
  habitat conditions, land acquisition activities, and the system status. Construction,
  maintenance, and wildfires are also described. Habitat management is covered; croplands,
  grasslands, wetlands, and wilderness areas are discussed. The wildlife section of
  the report discusses endangered species, threatened species, migratory birds, mammals,
  and non-migratory birds. Interpretation and recreation activities are outlined;
  topics include fishing, hunting, and law enforcement. Cooperative programs, items
  of interest, and safety information are included.\",\n\t\"license_title\": \"License
